import { View, Button, StyleSheet, Image, TextInput } from "react-native";
import React from 'react';

const HomeScreen = ({ navigation }) => {
    return (

        <View style={styles.container}>

            <Image source={require('C:/Users/rovic/Documents/CC2021/CC2021/new folder/BMI/assets/logo.png')}
                style={{ width: 150, height: 150 }}
            />
            <TextInput
                style={styles.input}
                placeholder='e.g Juan Dela Cruz'
            />

            <Button style={styles.butStart}
                color="#FFE652"
                title="Start"
                onPress={() =>
                    navigation.navigate('BMI', { name: 'BMI' })
                }
            />
        </View>
    );
};

export default HomeScreen;
const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: 'gray',

    },
    input: {
        backgroundColor: 'white',
        marginVertical: 30,
        height: 15,
        width: '80%',
    },

    title: {
        fontSize: 20,
        fontWeight: 'bold',
    },
    separator: {
        marginVertical: 30,
        height: 1,
        width: '80%',
    },
});
